import styled from 'styled-components';

export const BigText = styled.p`
  text-align: center;
  font-size: 20px;
  margin-bottom: 50px;
`;

export const ContactArea = styled.div`
  margin-top: auto;
  background: rgba(45,45,45,0.98);
  color: white;
`;

export const Credit = styled.div`
  text-align: center;
  a {
    color: white;
    font-weight: bold;
    text-decoration: none;
  }
`;
